// Get a list of all domain computer
using System.DirectoryServices.AccountManagement;

// Get a list of all domain computers
using (PrincipalContext context = new PrincipalContext(ContextType.Domain))
{
	ComputerPrincipal computerPrincipal = new ComputerPrincipal(context);
	PrincipalSearcher searcher = new PrincipalSearcher(computerPrincipal);

	foreach (var result in searcher.FindAll())
	{
		ComputerPrincipal computer = result as ComputerPrincipal;
		
		if (computer != null)
		{
			//computer.Dump();
			string samName = computer.SamAccountName[0..^1];
			string fqdn = GetFQDNFromDistinguishedName(computer.DistinguishedName);
			fqdn.Dump();
			if (SendPing(fqdn))
			{
				//$"{samName} is alive".Dump();
				// Check the winrar version
				string? version = GetWinrarVersion(samName);
				if (version is not null)
					version.Dump(samName);
			}
			else
			{
				$"{samName} is dead".Dump();
			}
		}
	}
}

bool SendPing(string destination)
{
	bool alive = false;
	for (int i = 0; i < 5; i++)
	{
		// send icmp ping and return immediatly if the PC responds
		try
		{
			alive = new System.Net.NetworkInformation.Ping().Send(destination).Status == System.Net.NetworkInformation.IPStatus.Success;
			if (alive)
				return true;
		}
		catch {}
	}
	return false;
}

string? GetWinrarVersion(string samName)
{
	string filePath = $@"\\{samName}\c$\Program Files\WinRAR\WinRAR.exe";
	if (File.Exists(filePath))
	{
		var versionInfo = FileVersionInfo.GetVersionInfo(filePath);
		return versionInfo.FileVersion;
	}
	return null;
}

string GetFQDNFromDistinguishedName(string distinguishedName)
{
	string[] parts = distinguishedName.Split(',');
	StringBuilder fqdn = new StringBuilder();

	fqdn.Append(parts[0].Substring(3));
	foreach (string part in parts)
	{
		if (part.StartsWith("DC=", StringComparison.OrdinalIgnoreCase))
		{
			if (fqdn.Length > 0)
				fqdn.Append('.');

			fqdn.Append(part.Substring(3));
		}
	}

	return fqdn.ToString();
}

