// –∞ –≤–µ–∫—Ç–æ—Ä –ø—Ä–µ–¥–ª–æ–∂–µ–Ω–∏–π ‚Äî vector<Sentence<Token>>.
template <typename Token>
using Sentence = vector<Token>;

template <typename TokenForwardIt>
TokenForwardIt FindSentenceEnd(TokenForwardIt tokens_begin, TokenForwardIt tokens_end) {
    const TokenForwardIt before_sentence_end
        = adjacent_find(tokens_begin, tokens_end, [](const auto& left_token, const auto& right_token) {
        return left_token.IsEndSentencePunctuation() && !right_token.IsEndSentencePunctuation();
            });
    return before_sentence_end == tokens_end ? tokens_end : next(before_sentence_end);
}

// –ö–ª–∞—Å—Å Token –∏–º–µ–µ—Ç –º–µ—Ç–æ–¥ bool IsEndSentencePunctuation() const
template <typename Token>
vector<Sentence<Token>> SplitIntoSentences(vector<Token> tokens) {
    // –ù–∞–ø–∏—à–∏—Ç–µ —Ä–µ–∞–ª–∏–∑–∞—Ü–∏—é —Ñ—É–Ω–∫—Ü–∏–∏, –Ω–µ –∫–æ–ø–∏—Ä—É—è –æ–±—ä–µ–∫—Ç—ã —Ç–∏–ø–∞ Token
    vector<Sentence<Token>> libr;

    //size_t tokens_size = tokens.size();
    auto it_start = tokens.begin();

    while (it_start <= tokens.end()) {
        Sentence<Token> sentence; //—Å–æ–∑–¥–∞–µ–º –ø—Ä–µ–¥–ª–æ–∂–µ–Ω–∏–µ, –∫–æ—Ç–æ—Ä–æ–µ –±—É–¥–µ–º –∑–∞–ø–æ–ª–Ω—è—Ç—å

        //—É–∑–Ω–∞–µ–º, –Ω–∞ –∫–∞–∫–æ–π –ø–æ–∑–∏—Ü–∏–∏ –Ω–∞—Ö–æ–¥–∏—Ç—Å—è –Ω–∞—à –∑–Ω–∞–∫ –ø—Ä–µ–ø–∏–Ω–∞–Ω–∏—è
        auto it_sent_end = FindSentenceEnd(it_start, tokens.end());
        auto dist_to_stop = distance(tokens.begin(), it_sent_end);

        //–†–µ–∑–µ—Ä–≤–∏—Ä—É–µ–º –ø–∞–º—è—Ç—å –¥–ª—è –∫–æ–ª-–≤–∞ —ç–ª–µ–º–µ–Ω—Ç–æ–≤ –¥–æ –ø–µ—Ä–≤–æ–≥–æ –ø—É–Ω–∫—Ç—É–∞—Ü–∏–æ–Ω–Ω–æ–≥–æ –∑–Ω–∞–∫–∞
        sentence.reserve(dist_to_stop);

        //–ó–∞–ø–æ–ª–Ω—è–µ–º –ø—Ä–µ–¥–ª–æ–∂–µ–Ω–∏–µ, –ø–µ—Ä–µ–º–µ—â–∞—è –∏–∑ tokens
        for (auto it = it_start; it <= it_sent_end; ++it) {
            //*it = move(tokens.at(count++));
            sentence.push_back(move(*it));
        }
        //–î–æ–±–∞–≤–ª—è–µ–º –ø—Ä–µ–¥–ª–æ–∂–µ–Ω–∏–µ –≤ —Å–ª–æ–≤–∞—Ä—å
        libr.push_back(move(sentence));

        //–£–¥–∞–ª—è–µ–º –ø—Ä–µ–¥–ª–æ–∂–µ–Ω–∏–µ, —á—Ç–æ–±—ã –ø–æ—Ç–æ–º —Å–æ–∑–¥–∞—Ç—å –µ–≥–æ —Å–Ω–æ–≤–∞
        //sentence.clear();
        //delete sentence;
        //it_start = tokens.at(++dist_to_stop);
        advance(it_start, dist_to_stop++);
    }

    return libr;
}

struct TestToken {
    string data;
    bool is_end_sentence_punctuation = false;

    bool IsEndSentencePunctuation() const {
        return is_end_sentence_punctuation;
    }
    bool operator==(const TestToken& other) const {
        return data == other.data && is_end_sentence_punctuation == other.is_end_sentence_punctuation;
    }
};

ostream& operator<<(ostream& stream, const TestToken& token) {
    return stream << token.data;
}

// –¢–µ—Å—Ç —Å–æ–¥–µ—Ä–∂–∏—Ç –∫–æ–ø–∏—Ä–æ–≤–∞–Ω–∏—è –æ–±—ä–µ–∫—Ç–æ–≤ –∫–ª–∞—Å—Å–∞ TestToken.
// –î–ª—è –ø—Ä–æ–≤–µ—Ä–∫–∏ –æ—Ç—Å—É—Ç—Å—Ç–≤–∏—è –∫–æ–ø–∏—Ä–æ–≤–∞–Ω–∏–π –≤ —Ñ—É–Ω–∫—Ü–∏–∏ SplitIntoSentences
// –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ –Ω–∞–ø–∏—Å–∞—Ç—å –æ—Ç–¥–µ–ª—å–Ω—ã–π —Ç–µ—Å—Ç.
void TestSplitting() {
    assert(SplitIntoSentences(vector<TestToken>({ {"Split"s}, {"into"s}, {"sentences"s}, {"!"s} }))
        == vector<Sentence<TestToken>>({ {{"Split"s}, {"into"s}, {"sentences"s}, {"!"s}} }));

    assert(SplitIntoSentences(vector<TestToken>({ {"Split"s}, {"into"s}, {"sentences"s}, {"!"s, true} }))
        == vector<Sentence<TestToken>>({ {{"Split"s}, {"into"s}, {"sentences"s}, {"!"s, true}} }));

    assert(SplitIntoSentences(vector<TestToken>(
        { {"Split"s}, {"into"s}, {"sentences"s}, {"!"s, true}, {"!"s, true}, {"Without"s}, {"copies"s}, {"."s, true} }))
        == vector<Sentence<TestToken>>({
            {{"Split"s}, {"into"s}, {"sentences"s}, {"!"s, true}, {"!"s, true}},
            {{"Without"s}, {"copies"s}, {"."s, true}},
            }));
}

int main() {
    TestSplitting();
}
